      <div className="nav-wrapper #1565c0 blue darken-3">
        <Link href="/">
          <a className="brand-logo">Logo</a>
        </Link>

        <ul id="nav-mobile" className="right hide-on-med-and-down">
          <li>
            <Link href="/login">
